import React from "react";
import dummyData from "../dummy-data";
import SearchBox from "./search";

const List = props => { 
    console.log(props);
    return(
        <div>   
        {
            props.searchData.map(list => {
                <div class='col'>
                    {list.id}
                    {list.title}
                    {list.content}
                </div>                 
            })
        }
            <button>Edit</button>
            <button>Delete</button>
        </div>
    );
};
